inline double CalculateExpectedLLForEmission(const size_t move, const uint8_t row,
                                             const size_t moment)
{
    double expectedLL = 0;
    for (size_t i = 0; i < OUTCOME_NUMBER; i++) {
        double curProb = emissionPmf[move][row][i];
        double lgCurProb = std::log(curProb);
        if (!std::isfinite(lgCurProb)) continue;
        if (moment == static_cast<uint8_t>(MomentType::FIRST))
            expectedLL += curProb * lgCurProb;
        else if (moment == static_cast<uint8_t>(MomentType::SECOND))
            expectedLL += curProb * (lgCurProb * lgCurProb);
    }
    return expectedLL;
}

Kit__500_Chem__2_BC__1_PW3_v2_Trans_v2_t_0_0_1_Model::Kit__500_Chem__2_BC__1_PW3_v2_Trans_v2_t_0_0_1_Model(const NucleotideLevelFeats& feats){

    for (size_t ctx = 0; ctx < CONTEXT_NUMBER; ++ctx) {
        const uint8_t bp = ctx & 3;  // (equivalent to % 4)

        const double cr = feats.crs[bp];
        const double dw_mean = feats.dw_means[bp];
        const double dw_var = feats.dw_vars[bp];

        std::array<char, 2> bases = Ctx2Bases(ctx);

        std::stringstream cr_boundaries_key_s;
        cr_boundaries_key_s << bases[0] << bases[1] << "_cr";
        std::string cr_boundaries_key = cr_boundaries_key_s.str();

        std::stringstream dw_mean_boundaries_key_s;
        dw_mean_boundaries_key_s << bases[0] << bases[1] << "_dw_mean";
        std::string dw_mean_boundaries_key = dw_mean_boundaries_key_s.str();

        std::stringstream dw_var_boundaries_key_s;
        dw_var_boundaries_key_s << bases[0] << bases[1] << "_dw_var";
        std::string dw_var_boundaries_key = dw_var_boundaries_key_s.str();

        const std::array<double, 3>& cr_boundaries = ctxStateFeatureBoundaries.at(cr_boundaries_key);
        const std::array<double, 3>& dw_mean_boundaries = ctxStateFeatureBoundaries.at(dw_mean_boundaries_key);
        const std::array<double, 3>& dw_var_boundaries = ctxStateFeatureBoundaries.at(dw_var_boundaries_key);

        int cr_bin = FindInsertionPosition(cr_boundaries.begin(), cr_boundaries.end(), cr, cr_boundaries.size());
        int dw_mean_bin = FindInsertionPosition(dw_mean_boundaries.begin(), dw_mean_boundaries.end(), dw_mean, dw_mean_boundaries.size());
        int dw_var_bin = FindInsertionPosition(dw_var_boundaries.begin(), dw_var_boundaries.end(), dw_var, dw_var_boundaries.size());

        std::stringstream trans_prob_key_s;
        trans_prob_key_s << bases[0] << bases[1] << '_' << cr_bin << '_' << dw_mean_bin << '_' << dw_var_bin;
        std::string trans_prob_key = trans_prob_key_s.str();
        
        double sum = 0.0;

        // cached transitions
        for (size_t j = 0; j < 4; ++j) {
            double xb = transProbs.at(trans_prob_key)[j] + 1e-8;
            ctxTrans_[ctx][j] = xb;
            sum += xb;
        }
        for (size_t j = 0; j < 4; ++j)
            ctxTrans_[ctx][j] /= sum;

        // cached expectations
        for (size_t move = 0; move < 3; ++move)
            for (size_t moment = 0; moment < 2; ++moment)
                cachedEmissionExpectations_[ctx][move][moment] =
                    CalculateExpectedLLForEmission(move, ctx, moment);
    }
}

std::unique_ptr<AbstractRecursor> Kit__500_Chem__2_BC__1_PW3_v2_Trans_v2_t_0_0_1_Model::CreateRecursor(const MappedRead& mr,
                                                                 double scoreDiff) const
{
    const double counterWeight = CounterWeight(
        [this](size_t ctx, MoveType m) { return ctxTrans_[ctx][static_cast<uint8_t>(m)]; },
        [](size_t ctx, MoveType m) {
            double r = 0.0;
            for (size_t o = 0; o < OUTCOME_NUMBER; ++o) {
                const double p = emissionPmf[static_cast<uint8_t>(m)][ctx][o];
                if (p > 0.0) r += p * std::log(p);
            }
            return r;
        },
        CONTEXT_NUMBER);

    return std::make_unique<Kit__500_Chem__2_BC__1_PW3_v2_Trans_v2_t_0_0_1_Recursor>(mr, scoreDiff, counterWeight);
}

std::vector<TemplatePosition> Kit__500_Chem__2_BC__1_PW3_v2_Trans_v2_t_0_0_1_Model::Populate(const std::string& tpl) const
{
    auto rowFetcher = [this](const NCBI2na prev, const NCBI2na curr) -> const double(&)[4]
    {
        const auto row = EncodeContext16(prev, curr);
        const double(&params)[4] = ctxTrans_[row];
        return params;
    };
    return AbstractPopulater(tpl, rowFetcher);
}

double Kit__500_Chem__2_BC__1_PW3_v2_Trans_v2_t_0_0_1_Model::ExpectedLLForEmission(const MoveType move, const AlleleRep& prev,
                                             const AlleleRep& curr, const MomentType moment) const
{
    auto cachedEmissionVisitor = [this](const MoveType move, const NCBI2na prev, const NCBI2na curr,
                                        const MomentType moment) -> double {
        const auto row = EncodeContext16(prev, curr);
        return cachedEmissionExpectations_[row][static_cast<uint8_t>(move)]
                                          [static_cast<uint8_t>(moment)];
    };
    return AbstractExpectedLLForEmission(move, prev, curr, moment, cachedEmissionVisitor);
}

